let loader = document.getElementById('splashscreen')

var anim;
var params = {
    container: loader,
    renderer: 'svg',
    loop: false,
    autoplay: true,
    animationData: animationData
};
anim = lottie.loadAnimation(params);

loader.animationDone = false;
anim.addEventListener('complete', ()=> {
  loader.animationDone = true;
  loader.innerHTML = ""
  var params = {
      container: loader,
      renderer: 'svg',
      loop: true,
      autoplay: true,
      animationData: animationData
  };
  anim = lottie.loadAnimation(params);
})

loader.animation = anim;

loader.fade = function (time){
  let startTime = 0;
  let next = (t) => {
    let x = Math.PI*(t - startTime)/time;
    if (x < Math.PI) {
      let y = (Math.cos(x) + 1)/2;
      this.style.setProperty('opacity', y);
      window.requestAnimationFrame(next);

    }else{
      this.style.setProperty('opacity', 0);
      this.style.setProperty('display', 'none');
    }
  }
  window.requestAnimationFrame((t) => {
    startTime = t;
    window.requestAnimationFrame(next);
  })
}

loader.completion = async function (){
  return new Promise((resolve, reject) => {
      if (this.animationDone) resolve(true);
      this.animation.addEventListener('complete', ()=> {
        resolve(true);
      })
  })
}
